import React from 'react';
import ReactDOM from 'react-dom/client';
import logo from './logo.svg';
import './App.css';

class App extends React.Component {
  constructor(props){
    super(props);
  }
  render () {
    return (
    <div className="App">
      <header>
        <h1>React Website</h1>
      </header>
    </div>
    );
  }
}

export default App;
